import React, { useState } from 'react';


const search = () => {

const [todoValue,setValue] = useState("");

const setTodoValue = (e) => {
    setValue(e.target.value);
}

    return (
        <div className="Search">
            <input type = "text" className="search" value={todoValue} onChange={setTodoValue}/>
        </div>
    )
}
